CREATE TABLE `ml_product` (
  `product_id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '产品ID',
  `check_id` bigint(11) DEFAULT NULL COMMENT '检测标准id',
  `line_id` bigint(11) DEFAULT NULL COMMENT '产线id',
  `uuid` varchar(255) DEFAULT NULL,
  `product_no` varchar(255) NOT NULL COMMENT '产品单号',
  `product_code` varchar(50) DEFAULT NULL COMMENT '产品编码',
  `product_name` varchar(50) DEFAULT NULL COMMENT '产品名称',
  `product_price` decimal(10,2) DEFAULT '0.00' COMMENT '产品单价',
  `product_num` decimal(10,2) DEFAULT NULL COMMENT '生产数量',
  `product_add_num` decimal(10,2) DEFAULT NULL COMMENT '生产累计数量',
  `product_unit` varchar(11) DEFAULT NULL COMMENT '产品单位',
  `create_time` datetime DEFAULT NULL COMMENT '建单时间',
  `create_by` varchar(11) DEFAULT NULL COMMENT '建单人',
  `remark` varchar(500) DEFAULT NULL COMMENT '备注',
  `product_specs` varchar(11) DEFAULT NULL,
  `start_time` datetime DEFAULT NULL COMMENT '开始时间',
  `end_time` datetime DEFAULT NULL COMMENT '交货时间',
  `order_no` varchar(255) DEFAULT NULL COMMENT '订单号',
  `update_time` datetime DEFAULT NULL,
  `status` varchar(255) DEFAULT NULL COMMENT '生产状态',
  `check_status` varchar(255) DEFAULT NULL COMMENT '检测状态',
  `mix_dosage` int(10) DEFAULT NULL COMMENT '拌和用量',
  `material_dosage` int(10) DEFAULT NULL COMMENT '物料用量',
  `mix_temperature` varchar(255) DEFAULT NULL COMMENT '拌合温度',
  `datastate` int(10) DEFAULT NULL COMMENT '删除状态',
  `class_number` varchar(255) DEFAULT NULL COMMENT '班别',
  `mix_state` int(10) DEFAULT NULL,
  `material_state` int(10) DEFAULT NULL,
  `check_time` datetime DEFAULT NULL COMMENT '检测时间',
  `examine` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`product_id`,`product_no`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=378 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT COMMENT='产品单';
